view-module.html.body:
View ModuleInterfaceinterface View extends Backbone.NativeView {

  // bounding element
  el: HTMLElement;
  // models to bind to the template
  models: NgBackbone.ModelMap;
  // collections to bind to the template
  collections: NgBackbone.CollectionMap;
  // array of subviews
  views: ViewMap;
  // instance of NgTemplate
  template: NgTemplate.NgTemplate;
  // constructor options getting available across the prototype
  options?: NgBackbone.ViewOptions;
  // template errors/warnings
  errors?: string[];
  // is this view ever rendered
  didComponentMount: boolean;
  // link to parent view in subview
  parent: NgBackbone.View;

  // constructor accepts extended map of options - see 'View Options' section
  constructor(options?: ngBackbone.ViewOptions);

  // Update the component (normally doesn't require manual invocation)
  render(): View;

  // Helper to subscribing `listenTo` way by a map
  listenToMap( eventEmitter: Backbone.Events, event: ngBackbone.DataMap ): View;

  // Before removing the view calls this method on every subview
  remove(): View;

  // LIFECYCLE METHODS

  // Override this method when you want to plug in straight before bounding el populated from the template
  componentWillMount(): void;

  // Override this method when you want to plug in straight after bounding el populated from the template
  componentDidMount(): void;

  // Override this method when you want to control manually if the template requires an update
  shouldComponentUpdate( nextScope: NgBackbone.DataMap ): boolean;

  // Override this method when you need preparation before an template update occurs
  componentWillUpdate( nextScope: NgBackbone.DataMap ): void;

  // Override this method when you need to operate on the DOM after template update
  componentDidUpdate( prevScope: NgBackbone.DataMap ): void;
}

Eventscomponent-will-update - fires straight before bounding el populated from the template

component-did-update - fires straight after bounding el populated from the template

component-will-mount - fires straight before bounding el populated from the template

component-did-mount - fires straight after bounding el populated from the template

View creates an instance of ngTemplate based on specified bounding element and template code. It binds models/collections of the given maps to the template. E.g. models: { foo: new Model() } becomes available in the template scope as foo. As soon the model changes (this.models.get("foo").set("bar", "value")) the template responds (foo.bar === "value");import { Component, View, Model, Collection } from "ng-backbone";

@Component({
  el: "ng-hero",
  models: {
    hero: new Model({
      "name": "Superman"
    })
  },
  collections: {
    powers: new Collection([
      { name: "Superhuman strength" },
      { name: "Flight" }
      { name: "Freezing breath" }
    ])
  },

  template: `
     has powers:



`
})

export class HeroView extends FormView {

  initialize() {
    this.render();
  }

}

We can specify collection getters by adding method named as "getCamelCase". When collection has such methods
they are invoked for values during passing data to view template:import { Component, View, Collection } from "ng-backbone";

class PowerCollection extends Collection {
  getSize(){
    return this.length;
  }
  getFavorite(){
    return this.filter(( model: any ) => {
      return model.get( "name" ).startsWith( "F" );
    });
  }
}

@Component({
  el: "ng-hero",

  collections: {
    powers: new PowerCollection([
      { name: "Superhuman strength" },
      { name: "Flight" }
      { name: "Freezing breath" }
    ])
  },

  template: `
     has
       powers, use but
      can use only 

`
})

export class HeroView extends FormView {

  initialize() {
    this.render();
  }

}

view-options.html.body:
View OptionsInterfaceinterface ngBackbone.ViewOptions extends Backbone.ViewOptions {
  models?: Models | {}; // injected shared model map
  collections?: Collections | {}; // injected shared collection map
  formValidators?: { [key: string]: Function; }; // form validator map
  logger?: LoggerOption; // subscribe for logging events
  views?: Views; // constructors for nested views
}
As you can see from the ViewOptions interface, we can create once option/model map and pass it into view. It makes possible to have shared models and collections across the views. When any of shared model/collection changes, all the related views synchronize:let heroes = new HeroCollection();

new HeroView({ collections: { heroes: heroes } });
new HeroListView({ collections: { heroes: heroes } });

subviews.html.body:
SubviewsWhen subview are specified in @Component, ngBackbone binds them gracefully on "component-did-update" event.Once successfully bound subview object stays untouched, but whenever new nodes coming up within parent view match a subview selector the new view instance gets created and attached to parent this.views map
ngBackbone allows subview selector to match mutiple element. In this case it creates a subview per matched elementWe can make our view to create automatically nested views by specifying a list of view constructors: @Component({
    views: {
      foo: FooView,
      bar: BarView
    }
  })
In this case nested view expects el view option filled with a selector relative to the parent view.  View object calls subview constructors after the first rendering. So it has inner DOM subtree already available and can bind subviews in there.  After subviews instantiated we can find them within this.view map of the parent view. If destroy a view with this.remove(), it automatically destroys every subview.When we need passing options to subview constructor, we can use the following syntax: @Component({
    views: {
      foo: [ FooView, { id: "foo" }],
      bar: [ BarView, { id: "bar" }]
    }
  })
Within parent component child ones are available in views map. You can access the instance of a sub-component as this.views.get( "name" ). Thus we obtain the control over child component from the parent:@Component({
  el: "ng-hello",
  events: {
    "click [data-bind=toggleFoo]" : "toggleFoo",
    "click [data-bind=toggleBar]" : "toggleBar"
  },
  views: {
    foo: FooView,
    bar: BarView
  },
  template: `
  Show Foo
  Show Bar
   `
})

class AppView extends View {
  toggleFoo(){
    this.views.get( "foo" ).toogle();
  }
  toggleBar(){
    this.views.get( "bar" ).toogle();
  }
}
And conversely you can communicate from child to parentclass FooView extends View {
  toggle(){
   // toggle view
   this.el.classList.toggle( "is-hidden", !this.el.classList.contains( "is-hidden" ) );
   // communicate back to parent
   this.parent.trigger( "my-custom-event" )l
  }
}
Maintaining mount on parent view changeLet's say we have an imaginary task. We have to create a list where every item has own view. So as for items the example view may look like:
  @Component({
    el: "ng-item",
    template: "it's item"
  })
  class ItemView extends View {
    initialize(){
      this.render();
    }
  }
The parent (list) view has a bound collection named items and a subview named also items. AS you remember we expect subview binding to ng-item element.  let items = new Collection([ new Model() ]);
  @Component({
    tagName: "ng-list",
    template: "",
    collections: {
      items: items
    },
    views: {
      items: ItemView
    }
  })
  class ListView extends View {
    initialize(){
      this.render();
    }
  }
Initially the collection has just a single element and on render we have it's item  let list = new ListView();
  list.views.getAll( "foo" ).length; // 1
  list.views.get( "foo" ); // ItemView
With method list.views.getAll( "foo" ) we can access the array of bound ItemView instances. Here it consists of one element.
However let's see what happens if we change the collection:  items.add([ new Model() ]);
  view.on( "component-did-update", () => {
    list.views.getAll( "foo" ).length; // 2
    list.views.get( "foo", 0 ); // ItemView
    list.views.get( "foo", 1 ); // ItemView
    done();
  });
The method list.views.getAll( "foo" ) indicates that we have now 2 subview instances matching ng-item element.
We can access a particular instance like list.views.get( "foo", index )

