Logging Eventslog.sync - fires every time the template synchronizes

log.listen - fires when View subscribes a model or a collection

log.template - fires on template warnings

You can subscribe for view events like that:let logger = {
  "log:sync log:template": function( msg: string, ...args: any[] ): void {
      console.log( `LOG(${this.cid}):`, msg, args );
   }
};

new FooView({ logger: logger });

formview-module.html.body:
FormView ModuleThis module is developed to simplify working forms. What do we usually do with Backbone? We subscribe for control change events and write view methods that update view as its state changes. FormView does it for us. It extracts the groups marked in the template with data-ng-group="groupName".
Within every found group it collects all the available controls input[name], textarea[name], select[name] and binds it to state models respectively. So when state of a control/group changes (e.g. validation fails) that gets available within the template immediately.For example we have a template:


    Invalid value


Until anything typed in to the input, it's invalid according to required restrictor. Thus template variable foo.bar.valid is false and the template shows container with error message. If we typed in a wrong value for email address foo.bar.valid again has 'false' and we can see the message. We can also access the sate of the group as foo.group. See below Control/Group State Model Interface for available properties.Interfaceinterface FormView extends View {
  // retrieve group data, e.g. for sending to storage
  getData( groupName: string ): ngBackbone.DataMap;

  // reset all state models, run it after form.reset()
  reset( groupName: string ): void;

  // emulate user input for unit-testing
  testInput( pointer: string, value: any ): Promise;
}
State Model

Form ValidationFormView subscribes for "input", "change" and "focus" events on the found controls. Whenever an event fires it updates the ControlState
based on actual element ValidityState plus validity state of specified custom validators.
If the state model reports that valid or touched property changed, FormView updates the GroupState.FormView contains following built-in validators:badInput - true if the user has provided input that the browser is unable to convert.

customError - true  if the element has been set custom validity message (e.g. by as custom validator)

stepMismatch - true if the control has step (type=number) attribute and its value does not fit the rules determined by the step attribute

tooLong -  true if the control has maxLength attribute and its value exceeds the specified maxlength

valueMissing - true  if the control has required attribute and an empty value

patternMismatch - true  if the control has pattern attribute and a value that does not match the specified pattern

rangeOverflow - true  if the control has max (type=number) attribute and a value greater than specified in the attribute

rangeUnderflow - true  if the control has min (type=number) attribute and a value less than specified in the attribute

typeMismatch - true  if the control has type email, tel or url and a value that does not match the corresponding type

If any of validations fails ControlState.validationMessage receives the corresponding error message.NOTE: Some user agents (e.g. PhantomJS) doesn't update el.validationMessage, therefore in such case it cannot be updated in the ControlState.Examples:

  Name is required

..





Example 1: Showing custom validation message per a controlimport { Component, FormView } from "ng-backbone/core";


@Component({
  el: "ng-hero",
  events: {
    "submit form": "onSubmitForm"
  },
  template: `


    Name



      Name is invalid 


    Hero Power

        Superhuman strength
        Flight
        Freezing breath




      Power is invalid 


    Submit



`
})

export class HeroView extends FormView {

  initialize() {
    this.render();
  }

  onSubmitForm( e:Event ){
    e.preventDefault();
    alert( "Form submitted" );
  }

}

Example 2: Showing all group validation messages as a listimport { Component, FormView } from "../ng-backbone/core";

@Component({
  el: "ng-hero",
  template: `



          : 



        Name


      Submit

`
})

export class HeroView extends FormView {
}
Custom Type ValidationYou can attach to a control one or many custom validators by using data-ng-validate attribute:@Component({
  el: "ng-hero",
  formValidators: {
    hexcolor( value: string ): Promise {
        let pattern = /^#(?:[0-9a-f]{3}){1,2}$/i;
        if ( pattern.test( value  ) ) {
          return Promise.resolve();
        }
        return Promise.reject( "Please enter a valid hexcolor e.g. #EEEAAA" );
      }
  },
  template: `




`
})

Multiple validators can be specified separated by a comma:
Every validator is a callback that returns a Promise. If validation passes the Promised resolves. Otherwise it rejects with error message passed as an argumentRemote ValidationYou can also have a validation that happens on the server.
import { Component, FormView, FormValidators, Debounce } from "ng-backbone/core";

class CustomValidators extends FormValidators {
   @Debounce( 350 )
   name( value: string ): Promise {
      return NamerModel.fetch();
   }
}

@Component({
  el: "ng-hero",
  formValidators: CustomValidators,
  template: `




`
})

FormView class the validator with every input event that is by default debounced 100ms. For validation via XHR request you may need greater debounce. We use @Debounce() validator to set it.

state-model.html.body:
State ModelInterfaceinterface State extends Backbone.Model {
}
Control State ModelForView creates and binds ControlState to every control found in the target group.Interfaceinterface ControlState extends State {
  value:    string,
  valid:    boolean,  // control's value is valid
  touched:  boolean, // control has been manually visited
  dirty:    boolean, // control's value has changed
  badInput: boolean, // indicating the user has provided input that the browser is unable to convert.
  customError: boolean, // indicating the element's custom validity message has been set to a non-empty string by calling the element's setCustomValidity() method.
  stepMismatch: boolean, // indicating the value does not fit the rules determined by the step attribute
  tooLong: boolean, // indicating the value exceeds the specified maxlength for HTMLInputElement or HTMLTextAreaElement objects
  valueMissing: boolean, // indicating the element has a required attribute, but no value.
  rangeOverflow: boolean, // indicating the value is greater than the maximum specified by the max attribute.
  rangeUnderflow: boolean, // indicating the value is less than the minimum specified by the min attribute.
  typeMismatch: boolean, // indicating the value is not in the required syntax
  patternMismatch: boolean, // indicating the value does not match the specified pattern
  validationMessage: string
}
Group State ModelForView creates and binds GroupState to every target group.Interfaceinterface GroupState extends State {
  valid:    boolean,  // all of group control values are valid
  dirty:    boolean // at least one of group control was manually changed
  validationMessage: string; // Last control validation messages
  validationMessages: [{ // array of control validation messages
    control: string;
    message: string;
  }];
}
